class Meal

	attr_accessor :food, :name, :portion_size

	def initialize(name)
		@name = name
		@food = []
		@portion_size = []
	end

	def add_food(new_food, portions_eaten)
		food.push(new_food)
		portion_size.push(portions_eaten)
	end

	def calories
		meal_calories = 0
		food.each_with_index do |food_item, i|
			meal_calories += food_item.total_calories(portion_size[i])
		end
		meal_calories
	end

	def to_s
		str = name + "\n"
		food.each_with_index do |food_item, i|
			str += food_item.to_s + " | #{@portion_size[i]}\n"
		end

		str
	end
end











